import { FC } from 'react';
import Layout from '../components/Layout';
import Link from 'next/link';

const Signin:FC = () => {
  return (
    <Layout>
      <a href="/">HOME</a>
      <h2>Signin page</h2>
    </Layout>
  );
};

export default Signin;
